(function() {
    var onManipulate;

    onManipulate = function() {
        var zoom;
        zoom = 1;
        $('.cropped').css({
            backgroundSize: $('.element').width() * zoom,
            width: $('.cropper').width() * zoom,
            height: $('.cropper').height() * zoom,
            backgroundPosition: "${-$('.cropper').offset().left * zoom}px ${-$('.cropper').offset().top * zoom}px"
    });
    $('.left').css({
        width: $('.cropper').offset().left
    });
    $('.right').css({
        width: $('.element').width() - ($('.cropper').offset().left + $('.cropper').outerWidth()),
        left: $('.cropper').offset().left + $('.cropper').outerWidth()
    });
    $('.top').css({
        width: $('.cropper').outerWidth(),
        height: $('.cropper').offset().top,
        top: 0,
        left: $('.cropper').offset().left
    });
    return $('.bottom').css({
        width: $('.cropper').outerWidth(),
        height: $('.element').height() - ($('.cropper').offset().top + $('.cropper').outerHeight()),
        top: $('.cropper').offset().top + $('.cropper').outerHeight(),
        left: $('.cropper').offset().left
    });
};

$(function() {
    $('.cropped').css({
        backgroundSize: $('.element').width(),
        backgroundPosition: "${-$('.cropper').offset().left}px ${-$('.cropper').offset().top}px"
});
onManipulate();
return $('.cropper').draggable({
    containment: '.element',
    cursor: 'move',
    drag: function(e) {
        return onManipulate();
    }
}).resizable({
    containment: '.element',
    handles: 'n, e, s, w, ne, nw, se, sw',
    maxWidth: $('.element').width(),
    maxHeight: $('.element').height(),
    resize: function(e) {
        return onManipulate();
    }
});
});

}).call(this);


